import React from "react";

const Contacts = ({ contacts }) => {
  return (
    <ul>
      {contacts.map((contact) => {
        return (
          <li>
            <p>
              <strong>Name:</strong>
              {contact.name}
            </p>
            <p>
              <strong>Puh.: </strong>
              {contact.phone}
            </p>
          </li>
        );
      })}
    </ul>
  );
};

export default Contacts;
